/*eslint-disable */
function recarga() {
  debugger;
  setTimeout(function () {
    window.location.reload();
  }, 880);
}

function toHome(action) {
  debugger;
  setTimeout(function () {
    action;
  }, 880);
}

module.exports = { recarga, toHome };
